import React, { Component } from 'react';
import './Hello_class.css';
import 'tachyons';

class Hello_Class extends Component {
	render() {
		return (
		<div className="f4 tc">
			<h1>Hello_Class</h1>
			<p>Welcome to React</p>
			<p>Para = {this.props.greeting}</p>
		</div>
		);
	}
}

export default Hello_Class;
